import { connect } from 'react-redux'
import Teachers from '../../../page/Set/Class/Detail/Teachers'
import {classDetail} from '../../redux/actions/classSynopsis'
function a(state) {
  // console.log(state);
  return {
    classDetail: state.classDetail
  }
}
function b(dispatch) {
  return {
    classDetail: (data) => { dispatch(classDetail(data)) }
  }
}

export default connect(a, b)(Teachers)
